import React, { useState, useEffect } from 'react'

function App(){

  const [data, SetData] = useState([{}])


  useEffect(()=> {

    fetch("http://localhost:5000/members").then(

      res=> res.json()
    ).then(
        data=> {

          SetData(data)
          console.log(data)

        }
    )
  }, [])





  return(

    <div>

       { (

        data.members.map((member,i) => (
          <p> key={i}>{member} </p>
        ))
       )} 

    </div>



  )





}

export default App;
